import json
import sys
from pathlib import Path

sys.path.insert(0, str(Path(__file__).parent.parent.parent))
from node_runtime import call_tool


def main():
    input_data = json.load(sys.stdin)

    story = input_data.get("story", "")

    sentences = split_into_sentences(story)
    translated_sentences = [quick_translator(sentence) for sentence in sentences]
    translated_story = " ".join(translated_sentences)

    if not translated_story:
        error_message = "Error translating the story. Please check the Quick Translator tool."
        print(json.dumps({"translated_story": error_message}))
    else:
        print(json.dumps({"translated_story": translated_story}))


def split_into_sentences(story):
    sentences = []
    current_sentence = ""
    for char in story:
        if char in [".", "!"]:
            sentences.append(current_sentence.strip())
            current_sentence = ""
        elif char.isspace():
            if current_sentence:
                sentences.append(current_sentence.strip())
                current_sentence = ""
        else:
            current_sentence += char
    if current_sentence:
        sentences.append(current_sentence.strip())
    return sentences


def quick_translator(sentence):
    try:
        translation = call_tool("quick_translator", sentence)
        return translation
    except Exception as e:
        error_message = "Error translating the sentence. Please check the Quick Translator tool."
        print(json.dumps({"translated_story": error_message}))
        return sentence


if __name__ == "__main__":
    main()

